const CommunityList = ({ communityList }) => {
  return (
    <div>
      {communityList.map((it) => (
        <div className="CommunityList" key={it.id}>
          <div>커뮤니티 사진: {it.community_picture}</div>
          <div>커뮤니티 이름 : {it.community_name}</div>
        </div>
      ))}
    </div>
  );

  CommunityList.defaultProps = {
    communityList: [],
  };
};

export default CommunityList;
